INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (2, 102301, 24, 24001, 10046, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 401, 0.0, "2020/07/31 12:00:00", 0.0, 0.0, "アヤネ", 2, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (2, 102301, 24, 24002, 10046, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 402, 2.21, "2020/07/31 12:00:00", 0.0, 0.0, "アヤネ", 1, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (2, 102301, 24, 24003, 10046, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 403, 0.0, "2020/07/31 12:00:00", 0.0, 0.0, "アヤネ", 2, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (1, 192201, 24, 24004, 10046, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 701, 1.99, "2020/07/31 12:00:00", 0.0, 0.0, "アサヒ", 2, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (2, 192201, 24, 24005, 10046, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 702, 2.21, "2020/07/31 12:00:00", 0.0, 0.0, "アサヒ", 1, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (1, 192201, 24, 24006, 10046, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 703, 3.33, "2020/07/31 12:00:00", 0.0, 0.0, "アサヒ", 2, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (2, 192301, 24, 24007, 10046, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 801, 0.0, "2020/07/31 12:00:00", 0.0, 0.0, "部員３", 2, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (2, 192301, 24, 24008, 10046, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 802, 2.68, "2020/07/31 12:00:00", 0.0, 0.0, "部員３", 1, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (2, 192301, 24, 24009, 10046, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 803, 0.0, "2020/07/31 12:00:00", 0.0, 0.0, "部員３", 2, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (1, 192501, 24, 24010, 10046, "やった！", 501, 0.0, "2020/07/31 12:00:00", 0.0, 0.0, "", 1, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (1, 192501, 24, 24011, 10046, "勝ったよ！", 502, 0.0, "2020/07/31 12:00:00", 0.0, 0.0, "", 1, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (1, 192501, 24, 24012, 10046, "いい調子！", 503, 0.0, "2020/07/31 12:00:00", 0.0, 0.0, "", 1, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (2, 113501, 24, 24013, 10046, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 111, 5.33, "2020/07/31 12:00:00", 0.0, 0.0, "ミサト", 6, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (2, 113501, 24, 24014, 10046, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 112, 6.85, "2020/07/31 12:00:00", 0.0, 0.0, "ミサト", 1, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (2, 113501, 24, 24015, 10046, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 113, 3.0, "2020/07/31 12:00:00", 0.0, 0.0, "ミサト", 1, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (2, 192401, 24, 24016, 10046, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 611, 6.11, "2020/07/31 12:00:00", 0.0, 0.0, "ダイチ", 1, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (2, 192401, 24, 24017, 10046, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 612, 6.75, "2020/07/31 12:00:00", 0.0, 0.0, "ダイチ", 1, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (2, 192401, 24, 24018, 10046, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 613, 0.0, "2020/07/31 12:00:00", 0.0, 0.0, "ダイチ", 2, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (1, 113401, 24, 24019, 10046, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 211, 4.52, "2020/07/31 12:00:00", 0.0, 0.0, "ハツネ", 2, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (1, 113401, 24, 24020, 10046, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 212, 3.89, "2020/07/31 12:00:00", 0.0, 0.0, "ハツネ", 2, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (2, 113401, 24, 24021, 10046, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 213, 13.49, "2020/07/31 12:00:00", 0.0, 0.0, "ハツネ", 1, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (2, 106501, 24, 24022, 10046, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 311, 3.17, "2020/07/31 12:00:00", 0.0, 0.0, "カヤ", 1, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (2, 106501, 24, 24023, 10046, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 312, 4.42, "2020/07/31 12:00:00", 0.0, 0.0, "カヤ", 1, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (1, 106501, 24, 24024, 10046, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 313, 2.89, "2020/07/31 12:00:00", 0.0, 0.0, "カヤ", 6, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (3, 102301, 24, 24025, 10046, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 421, 3.71, "2020/07/31 12:00:00", 0.0, 0.0, "アヤネ", 4, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (1, 192201, 24, 24026, 10046, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 721, 5.1, "2020/07/31 12:00:00", 0.0, 0.0, "アサヒ", 2, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (3, 192301, 24, 24027, 10046, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 821, 4.34, "2020/07/31 12:00:00", 0.0, 0.0, "部員３", 1, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (1, 192501, 24, 24028, 10046, "いい勝負だったよ\nまたやろうね", 521, 0.0, "2020/07/31 12:00:00", 0.0, 0.0, "", 1, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (2, 113501, 24, 24029, 10046, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 101, 5.62, "2020/07/31 12:00:00", -360.0, 0.0, "ミサト", 1, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (2, 113501, 24, 24030, 10046, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 102, 9.58, "2020/07/31 12:00:00", -360.0, 0.0, "ミサト", 1, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (2, 113501, 24, 24031, 10046, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 103, 0.0, "2020/07/31 12:00:00", -360.0, 0.0, "ミサト", 2, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (1, 113501, 24, 24032, 10046, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 104, 9.13, "2020/07/31 12:00:00", -360.0, 0.0, "ミサト", 2, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (2, 113501, 24, 24033, 10046, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 105, 8.27, "2020/07/31 12:00:00", -360.0, 0.0, "ミサト", 1, "2030/12/17 14:59:59");
